update   layer_type t  set t.SQLVIEW = 'SELECT dr.nid,
             dr.projectname,
             dr.requestdept,
             dr.digdept,
             dr.DIGROAD_INFO,
             dr.longitudeandlatitude as strcoords,
             dr.COORDINATE_TYPE as coordtype 
        from digroad dr
       WHERE dr.NODEID = ''effecting'' order by dr.coordinate_type desc' where t.lid = '401';

update   layer_type t  set t.SQLVIEW = 'select to_char(c.projectid) as projectid,
       c.location,
       c.contactperson,
       c.contactmode,
       to_char(c.status) as status,
       c.projectname as title,
       to_char(c.starttime, ''yyyy-mm-dd hh:mm:ss'') as starttime,
       to_char(c.endtime, ''yyyy-mm-dd hh:mm:ss'') as endtime,
       c.constructor,
       c.longitude,
       c.latitude,
       c.influencedsections,
       c.effectarea,
       c.description,
       temp.influencedsectionsname
  from CONSTRUCTION c
  left join (select a.projectid,
                    wm_concat(to_char(b.section_name)) as influencedsectionsname
               from CONSTRUCTION a
               JOIN bis_section b
                 on FIND_IN_SET(b.section_code, a.influencedsections) =
                    b.section_code
              GROUP BY a.projectid) temp
    on temp.projectid = c.projectid
 where c.starttime <= sysdate
   and c.endtime >= sysdate
   and c.status = 0' where t.lid = '402';
	  
commit;






