       dr.projectname,
	   dr.requestdept,
       dr.digdept,
	   dr.DIGROAD_INFO,
       dr.PRINCIPAL,
       dr.TELEPHONE,
       dr.longitudeandlatitude  as strcoords,
       dr.COORDINATE_TYPE  as coordtype,
       to_char(dr.begindate, ''yyyy-mm-dd'') begindate,
       to_char(dr.enddate, ''yyyy-mm-dd'') enddate,
