 order by dr.coordinate_type desc'
 where t.lid = '401';
 
 
 --更新管制图层
update layer_type t
   set t.SQLVIEW ='select to_char(c.projectid) as projectid,
       c.location,
       c.contactperson,
       c.contactmode,
       to_char(c.status) as status,
       c.projectname as title,
       to_char(c.starttime, ''yyyy-mm-dd hh:mm:ss'') as starttime,
       to_char(c.endtime, ''yyyy-mm-dd hh:mm:ss'') as endtime,
       c.constructor,
       c.longitude,
       c.latitude,
       c.influencedsections,
       c.effectarea,
       c.description
  from CONSTRUCTION c
 where c.starttime <= sysdate
   and c.endtime >= sysdate
   and c.status = 0' where t.lid = '402';
 
 
